import React from "react";
import styled from "styled-components";
const Header = () => {
  return (
    <>
      <MainHeader></MainHeader>
    </>
  );
};

export default Header;

const MainHeader = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  height: 72px;
  background-color: #141b29;
  width: 100vw;
`;
